    assert ctx.caller == __owner.get(
        ), 'Only the owner can access this function.'
    currency.transfer_from(amount=amount, to=ctx.this, main_account=address)
    bet_id = __get_next_bet_id()
    __bets[bet_id] = {'name': name, 'address': address, 'amount': amount}
    return f'Bet placed with ID {bet_id}.'


def __get_next_bet_id():
    current_id = __bet_counter.get()
    next_id = current_id + 1
    __bet_counter.set(next_id)
    return next_id


