@__export('con_dice2')
def accept_bet(bet_id: int, opponent_address: str, num1: int, num2: int):
    assert ctx.caller == __owner.get(
        ), 'Only the owner can access this function.'
    bet = __bets[bet_id]
    assert bet is not None, 'Bet ID does not exist.'
    assert 'opponent_address' not in bet, 'Bet has already been accepted and resolved.'
