    bet['opponent_address'] = opponent_address
    bettor_address = bet['address']
    total_amount = amount * 2
    commission = total_amount * __commission_rate.get()
    payout = total_amount - commission
    if num2 > num1:
        winner = opponent_address
    else:
        winner = bettor_address
    currency.transfer(amount=payout, to=winner)
    __bets[bet_id] = None
    return (
        f'Bet accepted and resolved. Winner is {winner}. Total amount {payout} transferred after {commission} commission.'
        )


