import currency
__manager = Variable(contract='con_xyz', name='manager')
__names = Hash(default_value=False, contract='con_xyz', name='names')
__balances = Hash(default_value=0, contract='con_xyz', name='balances')
__approvals = Hash(default_value=0, contract='con_xyz', name='approvals')
__expiry_times = Hash(default_value=None, contract='con_xyz', name=
    'expiry_times')
__owners = Hash(default_value=None, contract='con_xyz', name='owners')
__mint_price = Variable(contract='con_xyz', name='mint_price')
__royalty_fee_percentage = Variable(contract='con_xyz', name=
    'royalty_fee_percentage')
__registration_period = Variable(contract='con_xyz', name='registration_period'
    )
__contracts_allowlist = Variable(contract='con_xyz', name='contracts_allowlist'
    )
__main_name_to_address = Hash(default_value=None, contract='con_xyz', name=
    'main_name_to_address')
__address_to_main_name = Hash(default_value=None, contract='con_xyz', name=
    'address_to_main_name')


def ____():
    __manager.set(ctx.caller)
    __contracts_allowlist.set([])
    __mint_price.set(1)
    __royalty_fee_percentage.set(2)
    __registration_period.set(365)


def __assert_is_manager():
    assert ctx.caller == __manager.get(), 'You are not the manager'


def __assert_is_owner(address: str, name: str):
    assert __balances[address, name] == 1, 'You are not the owner of this name'


def __assert_if_contract_is_approved(contract: str):
    if 'con_' in contract:
        assert contract in __contracts_allowlist.get(
            ), 'This contract is not allowed to interact with this contract'


def __assert_is_approved_for_transfer(main_account: str, to: str, name: str):
    assert __approvals[main_account, to, name
        ] == 1, 'Name is not approved for transfer'


def __is_expired(name: str):
    expiry = __expiry_times[name]
    if expiry is None:
        return True
    return now >= expiry


def __assert_is_not_expired(name: str):
    assert not __is_expired(name), 'Name is expired'


@__export('con_xyz')
def mint_name(name: str):
    __assert_if_contract_is_approved(ctx.caller)
    name = name.lower()
    assert name.isalnum() and name.isascii(
        ), 'Name must be alphanumeric and ascii'
    assert len(name) >= 3, 'The minimum length is 3 characters'
    assert len(name) <= 32, 'The maximum length is 32 characters'
    if __names[name] != False:
        assert __is_expired(name
            ), 'Name already exists and has not expired yet.'
    currency.transfer_from(amount=__mint_price.get(), to=__manager.get(),
        main_account=ctx.caller)
    __names[name] = {}
    __expiry_times[name] = now + datetime.timedelta(days=
        __registration_period.get())
    __balances[ctx.caller, name] = 1
    __owners[name] = ctx.caller


@__export('con_xyz')
def transfer(name: str, to: str):
    __assert_is_not_expired(name)
    assert name != '', 'Please specify the Name you want to transfer'
    __assert_is_owner(ctx.caller, name)
    __balances[ctx.caller, name] = 0
    __balances[to, name] = 1
    __main_name_to_address[name] = None
    __address_to_main_name[ctx.caller] = None
    __names[name] = {}
    __owners[name] = to


