    __assert_is_owner(main_account, name)
    __assert_is_approved_for_transfer(main_account, to, name)
    __approvals[main_account, to, name] = 0
    __balances[main_account, name] = 0
    __balances[to, name] = 1
    __main_name_to_address[name] = None
    __address_to_main_name[main_account] = None
    __names[name] = {}
    __owners[name] = to


